import {SAVE_EX_REQUEST, SAVE_EX_SUCCESS, SAVE_EX_FAILURE} from "./exerciseTypes";
import axios from 'axios';

export const saveExercise = exercise => {
    return dispatch => {
        dispatch(saveExerciseRequest());
        axios.post("http://localhost:8081/rest/exercise", exercise)
            .then(response => {
                dispatch(saveExerciseSuccess(response.data));
            })
            .catch(error => {
                dispatch(saveExerciseFailure(error))
            });
    };
};

const saveExerciseRequest = () => {
    return {
        type: SAVE_EX_REQUEST
    };
};

const saveExerciseSuccess = book => {
    return {
        type: SAVE_EX_SUCCESS,
        payload: book
    };
};

const saveExerciseFailure = error => {
    return {
        type: SAVE_EX_FAILURE,
        payload: error
    };
};
